import React from "react";
import './Menubar.css';
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBasketShopping } from "@fortawesome/free-solid-svg-icons/faBasketShopping";
import LinkButton from "./../../Components/LinkButton/LinkButton";
const Menubar = ()=>{

    return(
        <div id="verticalmenu" className="verticalmenu">
            <div className="profilesection">
                    <div className="profilephoto">
                        <div className="head"></div>
                        <div className="body"></div>
                        <img src="" alt=""/>
                    </div>
                    <span style={{fontWeight:"700",padding:"10px 0 0 20px",fontSize:"20px",color:"#ffffff"}}>Account UserName</span>
            </div>
                    <div style={{width:"100%",display:"flex",justifyContent:"flex-end",alignItems:"center",height:"10%"}}>
                    <Link style={{width:"200px",textDecoration:"none"}}><LinkButton>Login</LinkButton></Link>                
                    <Link style={{width:"200px",textDecoration:"none"}}><LinkButton>Sign up</LinkButton></Link>
                    </div>
            
            <ul className="boxitems">
                <li>Notification</li>
                <li>WishList</li>
                <li><FontAwesomeIcon icon={faBasketShopping}/> Basket</li>
                <li>Setinge</li>
                <li>Contact US</li>
                <li>About US</li>
                <li>Help</li>
            </ul>
    </div>
    );
}
export default Menubar;
